1. Nous nous engageons à protéger la confidentialité des utilisateurs de nos applications. Dans cette politique de confidentialité, nous expliquons comment nous allons traiter tes informations personnelles. 
 2. Nous pouvons collecter, stocker et utiliser les types d'informations personnelles suivantes :
 * Des informations sur ton appareil ainsi que sur tes visites et ton utilisation de cette application (y compris ton adresse IP, ta localisation géographique, le type et la version du navigateur, le système d'exploitation, la source de référence, la durée de la visite et les chemins de navigation); 
 * Les informations que tu nous fournis lors de ton inscription; 
 * Ton email et nom lorsque tu crées ton profil; 
 * Les informations que tu fournis en complétant le profil de ton chien dans notre application; 
 * Les informations contenues dans ou se rapportant à toute communication que tu nous envoies ou que tu envoies via notre application (y compris le contenu de la communication et les métadonnées associées à la communication); 
 * Toute autre information personnelle que tu choisis de nous envoyer. 
 3. UTILISATION DE DOGO PAR LES MINEURS
Tu dois être âgé de 18 ans ou avoir atteint l'âge de la majorité dans ta province, territoire ou pays pour t'inscrire en tant qu'utilisateur enregistré des produits. Les personnes de moins de 18 ans, ou l'âge de la majorité applicable, ne peuvent utiliser les Produits qu'avec l'implication et le consentement d'un parent ou d'un tuteur légal, sous le compte de cette personne et autrement soumis aux présentes Conditions.
 4. Avant de nous divulguer les informations personnelles d'une autre personne, tu dois obtenir le consentement de cette personne pour la divulgation et le traitement de ces informations conformément à la présente politique de confidentialité. 
 5. Nous pouvons utiliser tes informations personnelles pour : 
 * Personnaliser nos plateformes pour toi; 
 * T'envoyer des notifications par courrier électronique que tu as spécifiquement demandées; 
 * T'envoyer notre lettre d'information par courrier électronique, si tu en as fait la demande (tu peux nous informer à tout moment si tu n'as plus besoin de la lettre d'information); 
 * T'envoyer des communications marketing relatives à notre entreprise (ou aux entreprises de tiers soigneusement sélectionnées) que nous pensons pouvoir t'intéresser, par la poste ou, si tu y consens expressément, par courrier électronique ou par une technologie similaire (tu peux nous informer à tout moment si tu n'as plus besoin de communications marketing); 
 * Fournir à des tiers des informations statistiques sur nos utilisateurs (mais ces tiers ne seront pas en mesure d'identifier un utilisateur individuel à partir de ces informations); 
 * Traiter les demandes de renseignements et les plaintes formulées par toi ou à ton sujet concernant notre demande; 
 * Maintenir notre application sécurisée et éviter la fraude.
 6. Nous ne communiquerons tes informations personnelles à aucun tiers sans ton consentement à des fins de marketing direct ou de celui d'un tiers. 
 7. Les informations personnelles que nous traitons pour quelque fin que ce soit ne seront pas conservées plus longtemps qu'il n'est nécessaire à cette fin ou à ces fins. 
 8. Médias téléchargés : 
 * Tu es le propriétaire du contenu et as le consentement de toutes les parties qui y apparaissent. 
 * Les examens vidéo sont stockés sur nos serveurs afin que tu puisses les consulter ultérieurement dans l'historique. Nous ne partageons pas les examens vidéo à des fins de marketing, avec des tiers ou avec d'autres utilisateurs. 
 * Nous avons le droit de partager les médias que tu télécharges pour les Challenges liés à nos activités de publicité et de marketing. 
 * Sur ta demande, nous supprimerons ou modifierons toujours le contenu que tu nous as fourni. 
 9. Nous conserverons les documents (y compris les documents électroniques) contenant des données personnelles : 
 * dans la mesure où la loi nous y oblige; 
 * si nous estimons que les documents peuvent être pertinents pour toute procédure judiciaire en cours ou future; et 
 * afin d'établir, d'exercer ou de défendre nos droits légaux (y compris la fourniture d'informations à des tiers à des fins de prévention de la fraude et de réduction du risque de crédit). 
 10. Nous prendrons des précautions techniques et organisationnelles raisonnables pour éviter la perte, l'utilisation abusive ou l'altération de tes informations personnelles. 
 11. Nous allons stocker toutes les informations personnelles que tu fournis sur nos serveurs sécurisés (protégés par mot de passe). 
 12. Tu reconnais que la transmission d'informations sur Internet est intrinsèquement peu sûre, et nous ne pouvons garantir la sécurité des données envoyées sur Internet. 
 13. Tu es responsable de la confidentialité du mot de passe que tu utilises pour accéder à notre application. nous ne te demanderons pas ton mot de passe (sauf si tu te connectes à notre application). 
 14. Tu peux nous demander de corriger, récupérer ou supprimer toutes les informations personnelles que nous détenons à ton sujet en nous contactant par e-mail ou via le système de messagerie de l'application. 
 15. Notre application inclut des hyperliens vers des sites Web tiers et des détails les concernant. Nous n'avons aucun contrôle sur les politiques de confidentialité et pratiques de confidentialité de ces sites Web tiers et n'en sommes pas responsables. 
 16. Nous pouvons mettre à jour cette politique de temps à autre en publiant une nouvelle version sur notre application et nous t'informerons des modifications apportées à cette politique. 
 17. Cette application appartient et est exploitée par Dogo App UG. Plus de détails sur l'entreprise : 
